import React, {useState, useEffect} from 'react';
import './App.css'


function Shop() {

    useEffect(()=>{
        fetchItems();    
    }, []);
    
    const [items, setItems] = useState([]);

    const fetchItems = async()=>{
        const data = await fetch('https://jsonplaceholder.typicode.com/todos');

        const items = await data.json();
        console.log(items);
        setItems(items);
    }

  return (
    <div>
      <h1>Shop Page</h1>
      {/* {items.map(items =>(
          <h1>{items.Title}</h1>
      ))} */}
    </div>
  );
}

export default Shop;
